(1, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'Guest must be over 18 years of age to check-in to this hotel.'),
(2, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'As per Government regulations, it is mandatory for all guests above 18 years of age to carry a valid photo identity card & address proof at the time of check-in. Please note that failure to abide by this can result with the hotel denying a check-in. Hotels normally do not provide any refund for such cancellations. '),
(3, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'The standard check-in and check-out times are 12 noon. Early check-in or late check-out is subject to hotel availability and may also be chargeable by the hotel. Any early check-in or late check-out request must be directed to and reconfirmed with the hotel directly. '),
(4, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'Failure to check-in to the hotel, will attract the full cost of stay or penalty as per the hotel cancellation policy.'),
(5, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'Hotels charge a compulsory Gala Dinner Supplement during Christmas, New Year\'s eve or other special events and festivals like Diwali or Dusshera. These additional  charge are not included in the booking amount and will be collected directly at the hotel. '),
(6, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'There might be seasonal variation in hotel tariff rates during Peak days, for example URS period in Ajmer or Lord Jagannath Rath Yatra in Puri, the room tariff differences if any will have to be borne and paid by the customer directly at the hotel, if the booking stay period falls during such dates.'),
(7, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'All additional charges other than the room charges and inclusions as mentioned in the booking voucher are to be borne and paid separately during check-out. Please make sure that you are aware of all such charges that may comes as extras. Some of them can be WiFi costs, Mini Bar, Laundry Expenses, Telephone calls, Room Service, Snacks etc. '),
(8, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'Some hotels may have policies that do not allow unmarried / unrelated couples or certain foreign nationalities to check-in without the correct documentation. No refund will be applicable in case the hotel denies check-in under such circumstances. If you have any doubts on this, do call us for any assistance'),
(9, 1, '2018-09-06 01:27:34', NULL, NULL, 1, 'Any changes or booking modifications are subject to availability and charges may apply as per the hotel policies.');
